@newyorkbloodcenter has issued a call for donations. Consider scheduling a visit to their Grand Central Donation Center in the Chanin Building on East 41st Street between Park & Lexington. 

It only takes one hour to donate, and a single donation can be used to save multiple lives. Nearly 2,000 donations are needed each day in New York and New Jersey alone. About one in seven hospital admissions requires a blood transfusion, and with a limited shelf life, supplies must be continually replenished.

Those in need include: cancer patients, accident, burn, or trauma victims, newborn babies and their mothers, transplant recipients, surgery patients, chronically transfused patients suffering from sickle cell disease or thalassemia, and many more. Donors with O-negative blood type, or ‚Äúuniversal donors,‚Äù are especially encouraged to donate, as their blood can be used in emergencies.

